import React from 'react';

import Square from './Square';
import  '../css/board.css';


const Board = () => {
  return (
    <div className="grid">
      <Square index={11}/>
      <Square index={12}/>
      <Square index={13}/>
      <Square index={14}/>
      <Square index={21}/>
      <Square index={22}/>
      <Square index={23}/>
      <Square index={24}/>
      <Square index={31}/>
      <Square index={32}/>
      <Square index={33}/>
      <Square index={34}/>
      <Square index={41}/>
      <Square index={42}/>
      <Square index={43}/>
      <Square index={44}/>
    </div>
  );
}

export default Board;
